The preferred way to interact with the cockpit is via the component system. To allow interaction, a manipulator has to be registered at F_4E_WSO_Cockpit.lua: -- ChaffMode: OFF, SGL, MULT, PROG
self:AddManipulator( "Chaff Mode", {component_path = "/WSO Cockpit/WSO Left Console/AN_ALE-40 CCU/Chaff Mode Knob"}
) After that, it can easily be interacted with, for example: Click("Chaff Mode", "MULT") or reading its current value: local cockpit = GetJester():GetCockpit()
local chaff_mode = cockpit:GetManipulator("Chaff Mode"):GetState()

