While you're probably already familiar with how to apply your custom texture to the jet (Just copy an existing one and replace the files keeping the names the same), I made a small library of textures to cut down on the overall size of a Livery. You can find these in the "commons" folder under \CoreMods\aircraft\F-4E\Liveries\F-4E-45MC\commons Trying to keep folder depth shallow this at first might look a bit messy but it actually makes it easier to apply the texture in your description.lua and does not bloat it too much with long folder paths. For example: the Folder "ALQ131_g" contains a Livery for the ALQ-131 Pod in Olive/Green Colors. You can tell your description.lua to use this Texture instead of the default white one from DCS when equiping the ALQ-131 to the Phantom ingame by putting this line of code into your description.lua file for both the Albedo and the Roughmet Texture: {"ALQ_131", 0 , "../commons/alq131_g/alq_131_diff", false};
{"ALQ_131", ROUGHNESS_METALLIC , "../commons/alq131_g/alq_131_diff_roughmet", false}; The first Value after the { in Brackets "" is the Material Name, in this case the ALQ_131. It can be a bit tricky to find these Material names through DCS. Feel free to ask in our Discord in the #liveries-lair channel we we'll happily try and provide the ones you are looking for. Using the same principle, you can apply custom Fligh Suit textures to your Pilot as well as a HGU-2 Texture. Here's an example of a German Luftwaffe F-4F Pilot and WSO being equiped with German Luftwaffe Flight Suits and Grey HGU-2 Helmets: {"PILOT_HGU-2_Helmet", 0 ,"../commons/HGU2_g/HGU-2_Helmet",false};
